  const [sname, setSname] = useState('')
  const [sdesc, setSdesc] = useState('')
  const [hasPos, setHasPos] = useState('')

  const [equity, setEquity] = useState({})

  const submitHandler = () => {
    setEquity
  }
    
  return (
    <div>
      <h2>Add New Equity</h2>
      <form>
        <label>SecurityID: </label>
        <input type='text' value={sid} onChange={(event) => {setSid(event.target.value)}}/>

        <br/>
        <label>Security Name: </label>
        <input type='text' value={sname} onChange={(event) => {setSname(event.target.value)}}/>

        <br/>
        <label>Security Description: </label>
        <input type='text' value={sdesc} onChange={(event) => {setSname(event.target.value)}}/>

        <br/>
        <label>hasPos: </label>
        <input type='text' value={hasPos} onChange={(event) => {setSname(event.target.value)}}/>
      </form>
    </div>
  )
}

export default AddEquity
